INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (125801, 24001, 321, 0, 1, 2, 1, 40011, "リリ", "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 1);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (126001, 24001, 322, 0, 1, 2, 2, 40011, "クリア", "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 1);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (126101, 24001, 323, 0, 1, 2, 3, 40011, "プレシア", "んーと。\nこれ、あげる。\nはい", 1);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (125801, 24001, 324, 0, 1, 2, 4, 40011, "リリ", "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 2);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (126001, 24001, 325, 0, 1, 2, 5, 40011, "クリア", "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 2);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (126101, 24001, 326, 0, 1, 2, 6, 40011, "プレシア", "お兄。\nきてくれて、うれしい", 2);
